import styled from 'styled-components';

const JobCard = styled.div`
background: #fff;
box-shadow: 5px 5px 20px rgba(0,0,0,0.05);
border-radius: 24px;
min-height:200px;
max-width:350px;
place-items:center;
padding: 20px 30px;`

export default JobCard;
